import React from 'react';
import './Header.css';

const Header = () => {
    return (
        <div className="Header">
            <h1> Cricketer Team Creator</h1>
            <nav className="Nav">
                <a href="/Home">Home</a>
                <a href="/Team">Team</a>
                <a href="/Payment">Payment</a>
            </nav>
        </div>
    );
};

export default Header;
